import {ContainerGlobal, InfoRyM, InfoAboutMe} from "./About"

const About = () =>{
    return(
        <ContainerGlobal>
            <InfoRyM>
                <h2>Rick and Morty API</h2>
                
                <p>Página creada y diseñada desde el Back-End hasta el Front-end de la mano de Henry.</p>
                <p></p>
            </InfoRyM>

            <InfoAboutMe>
                <h2>Gonzalo Nicolás Pua</h2>
            </InfoAboutMe>
        </ContainerGlobal>
    )
}

export default About;
